import "./Expenses.css";
import ExpensesItem from "./ExpensesItem";

function Expenses(props) {
  console.log(props);
  return (
    <div className="expenses">
      <ExpensesItem
        date={props.date[0]}
        price={props.price[0]}
        title={props.title[0]}
      />
      <ExpensesItem
        date={props.date[1]}
        price={props.price[1]}
        title={props.title[1]}
      />
      <ExpensesItem
        date={props.date[2]}
        price={props.price[2]}
        title={props.title[2]}
      />
      <ExpensesItem
        date={props.date[3]}
        price={props.price[3]}
        title={props.title[3]}
      />
    </div>
  );
}

export default Expenses;
